INSERT INTO `lmscategories` (`id`, `category`, `slug`, `image`, `description`, `record_updated_by`, `created_at`, `updated_at`) VALUES
(5, 'English', 'english', '', 'English is a West Germanic language that was first spoken in early medieval England and is now a global lingua franca', 1788, '2017-01-31 09:07:27', '2017-02-04 07:06:24'),
(6, 'General Knowledge', 'general-knowledge', '', 'General Knowledge questions and answers with explanation for interviews, entrance tests and competitive exams. Practice online GK quiz ', 1788, '2017-01-31 09:09:43', '2017-02-04 07:06:37'),
(7, 'Mathematics', 'mathematics', '', 'Mathematics is the study of topics such as quantity (numbers), structure, space, and change. There is a range of views among mathematicians and philosophers.', 1788, '2017-01-31 09:10:57', '2017-02-04 07:07:02'),
(8, 'Science', 'science', '', 'the intellectual and practical activity encompassing the systematic study of the structure and behaviour of the physical and natural world through observation and experiment.', 1788, '2017-01-31 09:42:28', '2017-02-04 07:07:25'),
(9, 'Social', 'social', '', 'various aspects or branches of the study of human society, considered as an educational discipline.', 1788, '2017-01-31 09:42:53', '2017-02-04 07:07:36'),
(11, 'General Studies', 'general-studies', '', 'Here are some help tools for tackling General Studies in the UPSC exams, ranging from the syllabus to reading list and other tips. ', 1788, '2017-02-01 04:34:03', '2017-02-04 07:06:50'),
(12, 'Natural Science', 'natural-science', '', 'a branch of science which deals with the physical world, e.g. physics, chemistry, geology, biology.\r\n', 1788, '2017-02-01 04:35:11', '2017-02-04 07:07:14'),
(13, 'Computer Basics', 'computer-basics', '', 'if you are new to computers or just want to update your computer skills, this free Computer Basics tutorial will show you how.', 1788, '2017-02-01 04:35:59', '2017-02-04 07:06:14');
INSERT INTO `lmscontents` (`id`, `title`, `slug`, `code`, `image`, `subject_id`, `content_type`, `is_url`, `file_path`, `description`, `record_updated_by`, `created_at`, `updated_at`) VALUES
(1, 'English Words', 'english-words-7e646f67332212911f37672ed368e336016ec733', 'EW1', '', 1, 'file', 0, '1-lms_file.pdf', '<p>There is a 14,000 version containing 140 multiple-choice items, with 10 items from each 1000 word family level. A learner&rsquo;s total score needs to be multiplied by 100 to get their total receptive vocabulary size.</p>\r\n', 1788, '2017-01-31 09:20:08', '2017-02-04 08:07:53'),
(2, 'Basic English', 'basic-english-6f52a3769a0a6d9faa7b3f41e8b95d9d144f6b53', 'BE1', '', 1, 'iframe', 0, 'https://www.youtube.com/embed/l0sQKfMH0sw', '<p>Study <em>basic English</em> grammar to help you become fluent in English. Understand the basic concepts of English grammar and learn English easily.</p>\r\n', 1788, '2017-01-31 09:24:40', '2017-02-04 08:06:02'),
(3, 'Numbers', 'numbers-f7cd902f8b8ffa03675eed9a135e786ed95f4db8', 'NS1', '', 21, 'url', 0, 'https://en.wikipedia.org/wiki/Number', '<p>an arithmetical value, expressed by a word, symbol, or figure, representing a particular quantity and used in counting and making calculations.</p>\r\n', 1788, '2017-01-31 09:26:23', '2017-02-04 08:08:28'),
(4, 'Basic Mathematics', 'basic-mathematics-c861a904fe9f35d77753f0f295e15d0067fbac9e', 'BM1', '', 21, 'video_url', 0, 'MathPlayground.com', '<p>A&nbsp;<strong>number</strong>&nbsp;is a&nbsp;mathematical object&nbsp;used to&nbsp;count,&nbsp;measure, and&nbsp;label. The original examples are the&nbsp;natural numbers&nbsp;<a href="https://en.wikipedia.org/wiki/1_(number)">1</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/2_(number)">2</a>,&nbsp;<a href="https://en.wikipedia.org/wiki/3_(number)">3</a>, and so forth. A notational&nbsp;symbol&nbsp;that represents a number is called a&nbsp;numeral</p>\r\n', 1788, '2017-01-31 09:28:29', '2017-02-04 07:42:52'),
(5, 'Telugu Letters', 'telugu-letters-2a974de906c5ef7a71854204b6ebeb9f8dc79c04', 'TL1', '', 6, 'iframe', 0, 'https://www.youtube.com/embed/Ztw7sua-JJ8', '<p><em>Telugu Alphabet</em>&nbsp;Learning Kit Workbook for Module-1. Transliterator: G ...&nbsp;<em>Telugu letters</em>&nbsp;irrespective of their usage in order to introduce them all to the learners.</p>\r\n', 1788, '2017-01-31 09:31:59', '2017-02-04 08:05:45'),
(6, 'Basic Telugu', 'basic-telugu-b32963e6624e70cf0298865255c94233bb38fa34', 'BT1', '', 6, 'iframe', 0, 'https://www.youtube.com/embed/8u70xtw9gJo?rel=0&controls=0&showinfo=0', '<p>to learning of&nbsp;<em>Telugu</em>&nbsp;by the most natural and the simplest method. It adopts the scientific approach, introducing&nbsp;<em>alphabets</em>, words, sentences in that order.</p>\r\n', 1788, '2017-01-31 09:34:36', '2017-02-04 07:41:17'),
(7, 'Lessons', 'lessons-3b0f92d23c8d1378ddd162b9254f0379791826a8', 'LS2', '', 2, 'url', 0, 'http://www.grammarbank.com/English-for-kids.html', '<p>When preparing <em>classes</em>, always bear in mind that the <em>children</em>, although .... They are one of the best ways for the <em>kids</em> to remember the <em>English</em> you have.</p>\r\n', 1788, '2017-01-31 09:49:19', '2017-02-04 07:40:44'),
(8, 'English-Sentences', 'english-sentences-e350813ac543dca05e881c8564a2ecfdb96f56a4', 'ES2', '', 2, 'iframe', 0, 'https://www.youtube.com/embed/3i5mLD5WpFk', '<p>to help <em>children</em> when they are just starting to <em>learn English</em>. The book has many of the words from the Cambridge <em>English</em>: Starters Word. List.</p>\r\n', 1788, '2017-01-31 09:51:19', '2017-02-04 07:44:37'),
(9, 'Telugu-Lessons', 'telugu-lessons-02e605d94d8b7481e47963b4f0a18f3aacc493cc', 'TL2', '', 7, 'iframe', 0, 'https://www.youtube.com/embed/829e5lTCsgE', '', 1788, '2017-01-31 09:57:20', '2017-02-04 08:05:25'),
(10, 'Telugu Grammar', 'telugu-grammar-3a5614d27f26b70d4bf1656814fe671a62d2102a', 'TG2', '', 7, 'url', 0, 'https://en.wikipedia.org/wiki/Telugu_grammar', '<p>e first treatise on Telugu grammar, the &quot;Andhra Shabda Chintamani&quot; was written in Sanskrit by Nannayya, who was considered as the first poet and translator of Telugu in the 11th century A.D. There was no grammatical work in Telugu prior to Nannayya&#39;s &quot;Andhra shabda chintamani&quot;.</p>\r\n', 1788, '2017-01-31 09:59:44', '2017-02-04 07:45:21'),
(11, 'Editions', 'editions-76848bd4d9804cdff1b9f2f8ab765a75b71aa754', 'ED2', '', 22, 'file', 0, '11-lms_file.pdf', '<p>It is intended to introduce students of engineering, physics, <em>mathematics</em>, computer ... This new <em>edition</em> will prepare the student for the current tasks and the future.</p>\r\n', 1788, '2017-01-31 10:01:44', '2017-02-04 08:08:42'),
