(1861, 20, 58, '', 'e26fc921c746517c34d06d1b7dc1d4b2a04bc9b5', 'para', '<p>Rearrange the following five sentences in proper sequence so as to for a meaningful paragraph, then answer the questions given below them.</p>\r\n\r\n<ol>\r\n <li>After Examining him, the doctor smiled at him mischievously and took out a syringe.</li>\r\n  <li>Thinking that he was really sick, his father summoned the family doctor.</li>\r\n <li>That day, Mintu wanted to take a day off from school</li>\r\n <li>Immediately, Mintu jumped up from his bed and swore the he was fine</li>\r\n  <li>Therefor; he pretended to be sick and remained in bed.</li>\r\n</ol>\r\n', '', 0, 5, '[{"question":"Which sentence should come third in the paragraph?","total_options":"5","options":[["1","2","3","4","5"]]},{"question":"Which sentence should come last in the paragraph?","total_options":"5","options":{"1":["1","2","3","4","5"]}},{"question":"Which sentence should come fourth in the paragraph?","total_options":"5","options":{"2":["1","2","3","4","5"]}},{"question":"Which sentence should come second in the paragraph?","total_options":"5","options":{"3":["1","2","3","4","5"]}},{"question":"Which sentence should come first in the paragraph?","total_options":"5","options":{"4":["1","2","3","4","5"]}}]', 5, '[{"answer":"2"},{"answer":"4"},{"answer":"1"},{"answer":"5"},{"answer":"3"}]', 20, 120, 'easy', 'No Hint', '<p>No Explanation</p>\r\n', NULL, 1, '2017-02-04 04:55:50', '2017-02-04 04:55:50'),
(1862, 20, 58, '', '32432c42911e1fcfc745b9149f41622f0cf63dc4', 'para', '<p>Rearrange the following five sentences in proper sequence to form a meaningful paragraph, then answer the questions given below.</p>\r\n\r\n<ol>\r\n <li>In fact, it prevent us from helping children to analyse conflict, to learn to cope with it and counter it.</li>\r\n <li>Children have always known that there is conflict in the adult world.</li>\r\n  <li>However, the make-believe world that 19th century rationally imposed on childhood in Europe and which we impose in an institutionalised manner through our modern education system can hardly be described as related in this regard.</li>\r\n  <li>We may therefore conclude that conflict in an institutionalised manner is not a matter of faith in children&#39;s capacities, rather, it is a lack of faith in ourselves as adults.</li>\r\n  <li>Further, psychologists tell us and story tellers have always known that the child&#39;s desire to search for order and coherence gathers strength from the knowledge of conflict.</li>\r\n</ol>\r\n', '', 0, 5, '[{"question":"Which of the following should be the fourth sentence in the paragraph?","total_options":"5","options":[["1","2","3","4","5"]]},{"question":"Which of the following should be the last sentence in the paragraph?","total_options":"5","options":{"1":["1","2","3","4","5"]}},{"question":"Which of the following should be the third sentence in the paragraph?","total_options":"5","options":{"2":["1","2","3","4","5"]}},{"question":"Which of the following should be the second sentence in the paragraph?","total_options":"5","options":{"3":["1","2","3","4","5"]}},{"question":"Which of the following should be the first sentence in the paragraph?","total_options":"5","options":{"4":["1","2","3","4","5"]}}]', 5, '[{"answer":"3"},{"answer":"4"},{"answer":"1"},{"answer":"5"},{"answer":"2"}]', 20, 150, 'hard', 'No Hint', '<p>No Explanation</p>\r\n', NULL, 1, '2017-02-04 05:03:58', '2017-02-04 05:03:58'),
(1863, 20, 58, '', 'c8222f8d98b8031c536fda1922f3ce88e18ce0a2', 'para', '<p>Rearrange the following six sentences in proper sequence to form a meaningful paragraph, then answer the questions given below.</p>\r\n\r\n<ol>\r\n  <li>Chandrakanth was shocked when he realised that the leg had lost sensation.</li>\r\n <li>when he tried to get up, he felt his leg was very heavy.</li>\r\n <li>He had to lie down hopelessly, till he saw a flash light</li>\r\n <li>It was an odd night time and hence nobody heard his voice.</li>\r\n <li>Due to sudden sprain chandrakanth fell down.</li>\r\n <li>Nervous with this realisation, he called out for help.</li>\r\n</ol>\r\n', '', 0, 5, '[{"question":"Which of the following should be the third sentence ?","total_options":"5","options":[["1","2","3","4","5"]]},{"question":"Which of the following should be the first sentence ?","total_options":"5","options":{"1":["1","2","3","4","5"]}},{"question":"Which of the following should be the second sentence ?","total_options":"5","options":{"2":["1","2","3","4","5"]}},{"question":"Which of the following should be the sixth sentence ?","total_options":"5","options":{"3":["6","5","4","3","2"]}},{"question":"Which of the following should be the fourth sentence ?","total_options":"5","options":{"4":["1","2","3","4","5"]}}]', 5, '[{"answer":"1"},{"answer":"5"},{"answer":"2"},{"answer":"3"},{"answer":"3"}]', 20, 160, 'medium', 'No Hint', '<p>No Explanation</p>\r\n', NULL, 1, '2017-02-04 05:10:38', '2017-02-04 05:10:38'),
(1864, 7, 19, '', '9c97932eb20fee31c052f27f49d43dea638d9165', 'match', '<p>Match the following Names ?</p>\r\n', '', 0, 4, '{"left":{"title":"Person","options":["BROTHER","NEPHEW","FATHER","UNCLE"]},"right":{"title":"Person","options":["MOTHER","AUNT","SISTER","NIECE"]}}', 4, '[{"answer":"3"},{"answer":"4"},{"answer":"1"},{"answer":"2"}]', 20, 120, 'easy', 'No Hint', '<p>No Explanation</p>\r\n', NULL, 1, '2017-02-04 05:27:31', '2017-02-04 05:27:31'),
(1865, 10, 28, '', '51856463fe5afbc02c57ae3beda7569b97127c20', 'match', '<p>Match the following objects ?</p>\r\n', '', 0, 4, '{"left":{"title":"Cup","options":["THOMAS CUP","SWAYTHLING CUP","DAVIS CUP","RYDER CUP"]},"right":{"title":"Sport Type","options":["LAWN TENNIS","TABLE TENNIS","BADMINTON","GOLF"]}}', 4, '[{"answer":"3"},{"answer":"2"},{"answer":"1"},{"answer":"4"}]', 20, 120, 'hard', 'No Hint', '<p>Cups and Sports Data</p>\r\n', NULL, 1, '2017-02-04 05:30:57', '2017-02-04 05:30:57'),
(1866, 40, 118, '', '91925ee292d0ef9d364740666932769c567c5f45', 'video', '<p>Rearrange the following five sentences in proper sequence to form a meaningful paragraph, then answer the questions given below.</p>\r\n\r\n<ol>\r\n <li>The history of mankind is full of such fightings between communities, nations and people.</li>\r\n  <li>From the primitive weapon of warfare, man has advanced to the modern nuclear weapons.</li>\r\n  <li>Ever since the dawn of civilisation man has been fighting with man.</li>\r\n  <li>A modern war is scientific in character, but the effect is the same wiping human existence out of this earth.</li>\r\n  <li>The only difference now seems to be in the efficiency of the instruments used for killing each other.</li>\r\n</ol>\r\n', '', 0, 5, '[{"question":"Which of the following should be the first sentence ?","total_options":"5","options":[["1","2","3","4","5"]]},{"question":"Which of the following should be the second sentence ?","total_options":"5","options":{"1":["1","2","3","4","5"]}},{"question":"Which of the following should be the fourth sentence ?","total_options":"5","options":{"2":["1","2","3","4","5"]}},{"question":"Which of the following should be the third sentence ?","total_options":"5","options":{"3":["1","2","3","4","5"]}},{"question":"Which of the following should be the fifth sentence ?","total_options":"5","options":{"4":["1","2","3","4","5"]}}]', 5, '[{"answer":"3"},{"answer":"1"},{"answer":"4"},{"answer":"2"},{"answer":"5"}]', 20, 180, 'easy', 'No Hint', '<p>No Explanation</p>\r\n', NULL, 1, '2017-02-04 05:37:15', '2017-02-04 05:37:15'),
(1867, 40, 118, '', 'c8ac6d7685c8414accd32ecc58b53b697cb01b61', 'video', '<p>Rearrange the following six sentences in proper sequence to form a meaningful paragraph, then answer the questions given below.</p>\r\n\r\n<ol>\r\n  <li>Its current was very powerful and could take away big tree trunks.</li>\r\n <li>There were some children, playing on the bank of waterway</li>\r\n</ol>\r\n', '1867question.mp4', 0, 5, '[{"question":"Which of the following should be the third sentence ?","total_options":"5","options":[["6","5","4","3","2"]]},{"question":"Which of the following should be the first sentence ?","total_options":"5","options":{"1":["6","5","4","3","2"]}},{"question":"Which of the following should be the sixth sentence ?","total_options":"5","options":{"2":["6","5","4","3","2"]}},{"question":"Which of the following should be the fourth sentence ?","total_options":"5","options":{"3":["5","4","3","2","1"]}},{"question":"Which of the following should be the second sentence ?","total_options":"5","options":{"4":["6","5","4","3","2"]}}]', 5, '[{"answer":"3"},{"answer":"4"},{"answer":"1"},{"answer":"4"},{"answer":"2"}]', 20, 180, 'easy', 'No Hint', '<p>No Explanation</p>\r\n', NULL, 1, '2017-02-04 05:40:21', '2017-02-13 17:11:53'),
(1868, 30, 88, '', 'a1600eaef9d512889121208b58fbe765cbb349b7', 'radio', '<p>Select a figure from amongst the Answer Figures which will continue the same series as established by the five</p>\r\n\r\n<p>Problem Figures.</p>\r\n', '1868question.png', 0, 5, '[{"option_value":"1","has_file":0,"file_name":""},{"option_value":"2","has_file":0,"file_name":""},{"option_value":"3","has_file":0,"file_name":""},{"option_value":"4","has_file":0,"file_name":""},{"option_value":"5","has_file":0,"file_name":""}]', 1, '3', 1, 10, 'easy', '', '<p>In each step, element at the upper-right position gets enlarged, inverts vertically and reaches the lower-left corner; the existing element at the lower-left position, is lost and a new small element appears at the upper-right position.</p>\r\n', NULL, 1, '2017-02-06 05:51:56', '2017-02-06 05:51:56');
